import React, { Component } from 'react'
import axios from 'axios'
import Cards from './Card'

const boxStyles = {
    padding: '0.5em',
    margin: ' 0.5em',
    border: '1px solid gray',
    borderRadius: '0.3em',
    textAlign: 'center'
}

export default class Servicios extends Component {
    state = {
        prop: [],
        value: 1
    }

    componentDidMount() {
        axios.get('http://localhost:3001/propiedades')
            .then(res => {
                const prop = res.data;
                this.setState({ prop });
            })
    }

    render() {
        const { prop } = this.state
        const { value } = this.state

        return (
            <div style={boxStyles}>
                <Cards
                    list={prop}
                    valor={ value}
                />
            </div>
        )
    }
}
